import axios from "axiosConfig";
import config from "config";
import React, { useEffect, useState } from "react";
import { Select, Divider, Collapse, Form, Button, Row, Col, Card, Input, DatePicker, InputNumber } from 'antd';
import { PlusOutlined, MinusCircleOutlined } from "@ant-design/icons";
import { useHistory, useLocation } from "react-router";
import ConfirmationModal from "components/Modal/ConfirmationModal";
import ENUMS from "constants/appEnums";
import HttpUtil from "util/HttpUtil";
import { useToasts } from "react-toast-notifications";

export default function TrackingSheet(props) {
    const { Option } = Select;
    const { Panel } = Collapse;
    const { TextArea } = Input;
    const history = useHistory();
    const locationData = useLocation();
    const { addToast } = useToasts();

    // const projectIds = useSelector(state => state.authReducer.userProjectIds);
    const [wellId, setWellId] = useState(null);

    const [items, setItems] = useState([{value: 1, label: 'Stage 1'}]);
    const [selectedStage, setSelectedStage] = useState("1");
    const [showConfirmationModal, setShowConfirmationModal] = useState();
    const [modalData, setModalData] = useState();

    const [dynamicFormNestItemValues, setDynamicFormNestItemValues] = useState({
        bht_f: null,
        bht_psi: null,
        customer: null,
        date: null,
        event_occur: null,
        field_engineer_days: null,
        field_engineer_nights: null,
        frac_design: null,
        plug_seat_technique: null,
        plug_type: null,
        seismos_data_collection: null,
        stage: 1,
    })

    const [perforationIntervalInformationValues, setPerforationIntervalInformationValues] = useState({
        acid: null,
        bottom_perf: null,
        clusters_number: null,
        displacement_vol_bottom: null,
        displacement_vol_plug: null,
        displacement_vol_top: null,
        diverter_type: null,
        perf_daiameter: null,
        perf_gun_desc: null,
        plug_depth: null,
        pumped_diverter: null,
        spf: null,
        top_perf: null
    })

    const [stageDataValues, setStageDataValues] = useState({
        Acid_volume_gals: null,
        Flush_volume_bbls: null,
        Max_prop_Conc_ppa: null,
        Slurry_volume_bbls: null,
        Total_lbs: null,
        Total_clean_fluid_volume_bbls: null,
        Total_pad_volume_bbls: null,
        Total_sand_lbs: null,
        base_fluid_density: null,
        base_fluid_type: null,
        isip: null,
        last_bbls: null,
        last_description: null,
        last_ppg: null,
        max_conc_density: null,
        opening_well: null,
        second_bbls: null,
        second_description: null,
        second_ppg: null,
        stage_end_time: null,
        stage_start_time: null,
        third_bbls: null,
        third_description: null,
    })

    const [propantFormValues, setPropantFormValues] = useState({
        proppantData: [
            {
                bulk_density: null,
                description: null,
                specific_gravity: null,
            }
        ]
    })

    const [activeDataFormValues, setActiveDataFormValues] = useState({
        amplitude: null,
        frequency: null,
        number_of_pulses: null,
        offset: null,
        periods: null,
        post_end_time: null,
        post_start_time: null,
        pre_end_time: null,
        pre_start_time: null,
    })

    const [notesFataFormValues, setNotesFataFormValues] = useState({
        other_notes: null,
        pre_notes: null,
        post_notes: null
    })


    const handeSelectStage = (e) => {
        setSelectedStage(e);
    }

    const addItem = () => {
        setItems([...items, {value: (items.length + 1), label: `Stage ${items.length + 1} (Added)`}])
    };

    const handleCancel = () => {
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const addStage = () => {
        setShowConfirmationModal(true);
    }

    const handleAddStageConfirmed = (data) => {
        addItem();
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const dynamicFormNestItemChange = (changedValue, newFormValues) => {
        setDynamicFormNestItemValues(newFormValues);
    }

    const perforationIntervalInformationChange = (changedValue, newFormValues) => {
        setPerforationIntervalInformationValues(newFormValues);
    }

    const stageDataChange = (changedValue, newFormValues) => {
        setStageDataValues(newFormValues);
    }

    const propantFormChange = (changedValue, newFormValues) => {
        setPropantFormValues(newFormValues);
    }

    const activeDataFormChange = (changedValue, newFormValues) => {
        setActiveDataFormValues(newFormValues);
    }

    const notesFataFormChange = (changedValue, newFormValues) => {
        setNotesFataFormValues(newFormValues);
    }


    const onDateChange = (date, dateString)  => {
        console.log(date, dateString);
    }

    const onChange = (date, dateString)  => {
        console.log(date, dateString);
    }

    const handleTrackingSheetSubmit = () => {
        const trackingSheet = {
            stage: Number(selectedStage),
            stage_tracking: {
                date: Number(dynamicFormNestItemValues.date.format('x')),
                customer: dynamicFormNestItemValues.customer,
                well: dynamicFormNestItemValues.well,
                stage: dynamicFormNestItemValues.stage,
                bht_f: dynamicFormNestItemValues.bht_f,
                bht_psi: dynamicFormNestItemValues.bht_psi,
                frac_design: dynamicFormNestItemValues.frac_design,
                field_engineer: {
                    days: dynamicFormNestItemValues.field_engineer_days,
                    nights: dynamicFormNestItemValues.field_engineer_nights,
                },
                plug_type: dynamicFormNestItemValues.plug_type,
                plug_seat_technique: dynamicFormNestItemValues.plug_seat_technique,
                did_an_event_occur: dynamicFormNestItemValues.event_occur,
                seismos_data_collection: dynamicFormNestItemValues.seismos_data_collection,
            },
            perforation_interval_information: {
                top_perf: perforationIntervalInformationValues.top_perf,
                bottom_perf: perforationIntervalInformationValues.bottom_perf,
                plug_depth: perforationIntervalInformationValues.plug_depth,
                n_clusters: Number(perforationIntervalInformationValues.clusters_number),
                perf_gun_description: perforationIntervalInformationValues.perf_gun_desc,
                perf_daiameter: perforationIntervalInformationValues.perf_daiameter,
                spf: perforationIntervalInformationValues.spf,
                pumped_diverter: perforationIntervalInformationValues.pumped_diverter,
                diverter_type: perforationIntervalInformationValues.diverter_type,
                acid: perforationIntervalInformationValues.acid,
                displacement_volume: {
                    top_perf: perforationIntervalInformationValues.displacement_vol_top,
                    bottom_perf: perforationIntervalInformationValues.displacement_vol_bottom,
                    plug: perforationIntervalInformationValues.displacement_vol_plug,
                }
            },
            stage_data: {
                stage_start_time: Number(stageDataValues.stage_end_time.format('x')),
                stage_end_time: Number(stageDataValues.stage_end_time.format('x')),
                opening_well: stageDataValues.opening_well,
                isip: stageDataValues.isip,
                fluid_parameters: {
                    base_fluid_type: stageDataValues.base_fluid_type,
                    base_fluid_density: stageDataValues.base_fluid_density,
                    max_conc_density: stageDataValues.max_conc_density,
                },
                fluids_injected_into_formation: {
                    last: {
                        description: stageDataValues.last_description,
                        bbls: stageDataValues.last_bbls,
                        ppg: stageDataValues.last_ppg,
                    },
                    second_to_last: {
                        description: stageDataValues.second_description,
                        bbls: stageDataValues.second_bbls,
                        ppg: stageDataValues.second_ppg,
                    },
                    third_to_last: {
                        description: stageDataValues.third_description,
                        bbls: stageDataValues.third_bbls,
                        ppg: stageDataValues.third_ppg,
                    }
                },
                propant_data: propantFormValues.proppantData,
                pumping_summary: {
                    max_prop_conc: {design: stageDataValues.max_prop_conc_ppa_design, actual: stageDataValues.max_prop_conc_ppa_actual},
                    total_pad_volume: {design: stageDataValues.total_pad_volume_bbls_design, actual: stageDataValues.total_pad_volume_bbls_actual},
                    total_clean_fluid_volume: {design: stageDataValues.total_clean_fluid_volume_bbls_design, actual: stageDataValues.total_clean_fluid_volume_bbls_actual},
                    total_forty_seventy: {design: stageDataValues.total_lbs_design, actual: stageDataValues.total_lbs_actual},
                    total_sand: {design: stageDataValues.total_sand_lbs_design, actual: stageDataValues.total_sand_lbs_actual},
                    acid_volume: {design: stageDataValues.acid_volume_gals_design, actual: stageDataValues.acid_volume_gals_actual},
                    flush_volume: {design: stageDataValues.flush_volume_bbls_design, actual: stageDataValues.flush_volume_bbls_actual},
                    slurry_volume: {design: stageDataValues.slurry_volume_bbls_design, actual: stageDataValues.slurry_volume_bbls_actual},
                }

            },
            active_data: {
                pilsing_parameters: {
                    wave_type: activeDataFormValues.wave_type,
                    periods: activeDataFormValues.periods,
                    freq: activeDataFormValues.frequency,
                    offset: activeDataFormValues.offset,
                    amplitude: activeDataFormValues.amplitude,
                },
                pre_frac_pulses: {start_time: Number(activeDataFormValues.pre_start_time.format('x')), end_time: Number(activeDataFormValues.pre_end_time.format('x')), n_pulses: Number(activeDataFormValues.pre_number_of_pulses)},
                post_frac_pulses: {start_time: Number(activeDataFormValues.post_start_time.format('x')), end_time: Number(activeDataFormValues.post_end_time.format('x')), n_pulses: Number(activeDataFormValues.post_number_of_pulses)},
            },
            notes: {
                pre_frac_pulse: notesFataFormValues.pre_notes,
                post_frac_pulse: notesFataFormValues.post_notes,
                other: notesFataFormValues.other_notes,
            }
        }
        axios.post(config.API_URL + ENUMS.API_ROUTES.TRACKING_SHEET_CREATE + '/' + wellId,
            {
                ...trackingSheet
            }, {...HttpUtil.adminHttpHeaders()})
            .then(res => {
                if (res.status === 201) {
                    addToast("Tracking sheet data added successfully.", { 
                        appearance: 'success',
                        autoDismiss: true
                    });
                }
            })
            .catch(e => {
                console.log(e)
            });
    }

    const fetchStagesSubmitted = (well_id) => {
        axios.get(config.API_URL + ENUMS.API_ROUTES.TRACKING_SHEET_LIST + '/' + well_id,
        {
            ...HttpUtil.adminHttpHeaders(),
        })
        .then(res => {
            if (res.status === 200 && res.data) {
                fetchTrackingSheet(res.data.stages[0].sheet_id);
            }
        })
        .catch(e => {
            console.log(e)
        })
    }

    useState(() => {
        // const wellId = history.location.pathname.split("/admin/")[1].split("/")[1];
        // const well = project.wellInfoValues.find(well => well.id == wellId);
        // console.log(well);
        // const stages = [];
        // for (let step = 1; step <= well.no_of_stages; step++) {
        //     stages.push("Stage " + step);
        // }
        // setItems(stages);
        if(locationData.pathname === (ENUMS.ROUTES.ADMIN + ENUMS.ROUTES.TRACKING_SHEET)) {
            console.log(`first time: ${locationData.pathname}`) 
            if (locationData.state && locationData.state.wellId) {
                console.log(locationData.state.wellId);
                setWellId(locationData.state.wellId);
                fetchStagesSubmitted(locationData.state.wellId);
            }
            else if (locationData.search) {
                const params = new URLSearchParams(locationData.search);
                const wellIdSearch = params.get('wellId');
                console.log(wellIdSearch);
                setWellId(wellIdSearch);
                fetchStagesSubmitted(wellIdSearch);
            }
        }
    })

    useEffect(() => {
        return history.listen((location) => { 
            if(location.pathname === (ENUMS.ROUTES.ADMIN + ENUMS.ROUTES.TRACKING_SHEET)) {
                console.log(`You changed the page to: ${location.pathname}`) 
                if (location.state && location.state.wellId) {
                    console.log(location.state.wellId);
                    setWellId(location.state.wellId);
                    fetchStagesSubmitted(location.state.wellId);
                }
                else if (location.search) {
                    const params = new URLSearchParams(location.search);
                    const wellIdSearch = params.get('wellId');
                    console.log(wellIdSearch);
                    setWellId(wellIdSearch);
                    fetchStagesSubmitted(wellIdSearch);
                }
            }
        }) 
    }, [history])
    return (
        <>
            <Card bordered={false} style={{ width: '100%', marginBottom: '5px' }}>
                <div className="">
                    <Row gutter={24} className="flex items-center">
                        <Col span={20}>
                            <div><strong>Tracking sheet</strong></div>
                        </Col>
                        <Col span={4}>
                            <Select
                                style={{ width: "100%" }}
                                placeholder="Stage"
                                value={selectedStage}
                                onChange={(e) => handeSelectStage(e)}
                                dropdownRender={menu => (
                                    <div>
                                        {menu}
                                        <Divider style={{ margin: '4px 0' }} />
                                        <div style={{ display: 'flex', flexWrap: 'nowrap', padding: 8 }}>
                                        <button
                                            className="no-style"
                                            style={{ flex: 'none', padding: '8px', display: 'block', cursor: 'pointer', width: '100%' }}
                                            onClick={(e) => addStage()}
                                        >
                                            <PlusOutlined /> Add stage
                                        </button>
                                        </div>
                                    </div>
                                )}
                            >
                                {items.map(item => (
                                    <Option key={item.value}>{item.label}</Option>
                                ))}
                            </Select>
                        </Col>
                    </Row>
                </div>
            </Card>
            <Card>
                <Collapse>
                    <Panel header={<strong>Stage Tracking</strong>} >
                        <Card>
                            <Form
                                name="dynamic_form_nest_item"
                                onValuesChange={dynamicFormNestItemChange}
                                autoComplete="off"
                                initialValues={dynamicFormNestItemValues}
                            >
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'date'}
                                            label="Date"
                                            labelCol={{span: 5, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <DatePicker onChange={onDateChange} className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}></Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'customer'}
                                            label="Customer"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'field_engineer_days'}
                                            label="Field engineer (Days)"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'well'}
                                            label="Well"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'field_engineer_nights'}
                                            label="Field engineer (Nights)"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'stage'}
                                            label="Stage"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'plug_type'}
                                            label="Plug type"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'bht_f'}
                                            label="BHT [F]"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'plug_seat_technique'}
                                            label="Plug seat technique"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'bht_psi'}
                                            label="BHT [psi]"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'event_occur'}
                                            label="Did an event occur"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'frac_design'}
                                            label="Frac design"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'seismos_data_collection'}
                                            label="Seismos data collection"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                            </Form>
                        </Card>
                    </Panel>
                    <Panel header={<strong>Perforation interval information</strong>} >
                        <Card>
                            <Form
                                name="perforation_interval_information"
                                onValuesChange={perforationIntervalInformationChange}
                                autoComplete="off"
                                initialValues={perforationIntervalInformationValues}
                            >
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'top_perf'}
                                            label="Top perf [MD]"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'perf_daiameter'}
                                            label="Perf daiameter [in]"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'bottom_perf'}
                                            label="Bottom perf"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'spf'}
                                            label="SPF"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'plug_depth'}
                                            label="Plug depth [MD]"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'pumped_diverter'}
                                            label="Pumped diverter"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'clusters_number'}
                                            label="# of clusters"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <InputNumber className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'diverter_type'}
                                            label="Diverter type"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    </Row>
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'perf_gun_desc'}
                                            label="Perf gun description"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'acid'}
                                            label="Acid"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Divider orientation="left" plain><strong>Displacement Volume</strong></Divider>
